import Foundation
import XCTest

@testable import SystemStrings

// MARK: - StoreKit Tests

@available(iOS 3.0, *)
final class StoreKitStringsTests: XCTestCase {

    override func tearDown() {
        super.tearDown()
        Util｜StoreKit.preferredLocalization = nil
    }

    func test_default() {
        Util｜StoreKit.preferredLocalization = nil
        XCTAssertEqual(String.AGREE｜StoreKit, "\u{41}\u{67}\u{72}\u{65}\u{65}")
        XCTAssertEqual(String.AGREE_TEXT｜StoreKit, "\u{49}\u{20}\u{61}\u{67}\u{72}\u{65}\u{65}\u{20}\u{74}\u{6F}\u{20}\u{74}\u{68}\u{65}\u{20}\u{69}\u{54}\u{75}\u{6E}\u{65}\u{73}\u{20}\u{54}\u{65}\u{72}\u{6D}\u{73}\u{20}\u{61}\u{6E}\u{64}\u{20}\u{43}\u{6F}\u{6E}\u{64}\u{69}\u{74}\u{69}\u{6F}\u{6E}\u{73}\u{2E}")
        XCTAssertEqual(String.CANCEL｜StoreKit, "\u{43}\u{61}\u{6E}\u{63}\u{65}\u{6C}")
        XCTAssertEqual(String.CLOUD_SERVICE_SETUP_VIEW_CONTROLLER_LOAD_PREEMPTED｜StoreKit, "\u{43}\u{6C}\u{6F}\u{75}\u{64}\u{20}\u{73}\u{65}\u{72}\u{76}\u{69}\u{63}\u{65}\u{20}\u{73}\u{65}\u{74}\u{75}\u{70}\u{20}\u{76}\u{69}\u{65}\u{77}\u{20}\u{63}\u{6F}\u{6E}\u{74}\u{72}\u{6F}\u{6C}\u{6C}\u{65}\u{72}\u{20}\u{6C}\u{6F}\u{61}\u{64}\u{20}\u{77}\u{61}\u{73}\u{20}\u{70}\u{72}\u{65}\u{2D}\u{65}\u{6D}\u{70}\u{74}\u{65}\u{64}")
        XCTAssertEqual(String.CLOUD_SERVICE_SETUP_VIEW_CONTROLLER_MISSING_SYSTEM_MUSIC_APPLICATION｜StoreKit, "\u{43}\u{6C}\u{6F}\u{75}\u{64}\u{20}\u{73}\u{65}\u{72}\u{76}\u{69}\u{63}\u{65}\u{20}\u{73}\u{65}\u{74}\u{75}\u{70}\u{20}\u{76}\u{69}\u{65}\u{77}\u{20}\u{63}\u{6F}\u{6E}\u{74}\u{72}\u{6F}\u{6C}\u{6C}\u{65}\u{72}\u{20}\u{6C}\u{6F}\u{61}\u{64}\u{20}\u{66}\u{61}\u{69}\u{6C}\u{65}\u{64}\u{20}\u{62}\u{65}\u{63}\u{61}\u{75}\u{73}\u{65}\u{20}\u{4D}\u{75}\u{73}\u{69}\u{63}\u{20}\u{61}\u{70}\u{70}\u{20}\u{77}\u{61}\u{73}\u{20}\u{64}\u{65}\u{6C}\u{65}\u{74}\u{65}\u{64}\u{2E}\u{20}\u{54}\u{68}\u{65}\u{20}\u{4D}\u{75}\u{73}\u{69}\u{63}\u{20}\u{61}\u{70}\u{70}\u{20}\u{63}\u{61}\u{6E}\u{20}\u{62}\u{65}\u{20}\u{72}\u{65}\u{69}\u{6E}\u{73}\u{74}\u{61}\u{6C}\u{6C}\u{65}\u{64}\u{20}\u{66}\u{72}\u{6F}\u{6D}\u{20}\u{74}\u{68}\u{65}\u{20}\u{41}\u{70}\u{70}\u{20}\u{53}\u{74}\u{6F}\u{72}\u{65}\u{2E}")
        XCTAssertEqual(String.CLOUD_SERVICE_SETUP_VIEW_CONTROLLER_REQUIRES_ACTION｜StoreKit, "\u{43}\u{6C}\u{6F}\u{75}\u{64}\u{20}\u{73}\u{65}\u{72}\u{76}\u{69}\u{63}\u{65}\u{20}\u{73}\u{65}\u{74}\u{75}\u{70}\u{20}\u{76}\u{69}\u{65}\u{77}\u{20}\u{63}\u{6F}\u{6E}\u{74}\u{72}\u{6F}\u{6C}\u{6C}\u{65}\u{72}\u{20}\u{72}\u{65}\u{71}\u{75}\u{69}\u{72}\u{65}\u{73}\u{20}\u{61}\u{6E}\u{20}\u{61}\u{63}\u{74}\u{69}\u{6F}\u{6E}\u{20}\u{61}\u{73}\u{20}\u{70}\u{61}\u{72}\u{74}\u{20}\u{6F}\u{66}\u{20}\u{74}\u{68}\u{65}\u{20}\u{6F}\u{70}\u{74}\u{69}\u{6F}\u{6E}\u{73}\u{20}\u{66}\u{6F}\u{72}\u{20}\u{74}\u{68}\u{65}\u{20}\u{6C}\u{6F}\u{61}\u{64}\u{20}\u{63}\u{6F}\u{6D}\u{6D}\u{61}\u{6E}\u{64}")
        XCTAssertEqual(String.DISAGREE｜StoreKit, "\u{44}\u{69}\u{73}\u{61}\u{67}\u{72}\u{65}\u{65}")
        XCTAssertEqual(String.INVALID_PRODUCTS_FOUND｜StoreKit, "\u{4F}\u{6E}\u{65}\u{20}\u{6F}\u{72}\u{20}\u{6D}\u{6F}\u{72}\u{65}\u{20}\u{70}\u{72}\u{6F}\u{64}\u{75}\u{63}\u{74}\u{20}\u{69}\u{64}\u{65}\u{6E}\u{74}\u{69}\u{66}\u{69}\u{65}\u{72}\u{73}\u{20}\u{61}\u{72}\u{65}\u{20}\u{69}\u{6E}\u{76}\u{61}\u{6C}\u{69}\u{64}")
        XCTAssertEqual(String.NETWORK_FAILED｜StoreKit, "\u{43}\u{6F}\u{75}\u{6C}\u{64}\u{20}\u{6E}\u{6F}\u{74}\u{20}\u{63}\u{6F}\u{6E}\u{6E}\u{65}\u{63}\u{74}\u{20}\u{74}\u{6F}\u{20}\u{74}\u{68}\u{65}\u{20}\u{69}\u{54}\u{75}\u{6E}\u{65}\u{73}\u{20}\u{53}\u{74}\u{6F}\u{72}\u{65}")
        XCTAssertEqual(String.PERMISSION_DENIED｜StoreKit, "\u{54}\u{68}\u{65}\u{20}\u{72}\u{65}\u{71}\u{75}\u{65}\u{73}\u{74}\u{69}\u{6E}\u{67}\u{20}\u{61}\u{70}\u{70}\u{20}\u{64}\u{6F}\u{65}\u{73}\u{20}\u{6E}\u{6F}\u{74}\u{20}\u{68}\u{61}\u{76}\u{65}\u{20}\u{74}\u{68}\u{65}\u{20}\u{6E}\u{65}\u{63}\u{65}\u{73}\u{73}\u{61}\u{72}\u{79}\u{20}\u{70}\u{65}\u{72}\u{6D}\u{69}\u{73}\u{73}\u{69}\u{6F}\u{6E}\u{73}")
        XCTAssertEqual(String.PRIVACY_ACKNOWLEDGEMENT_REQUIRED｜StoreKit, "\u{54}\u{68}\u{65}\u{20}\u{6C}\u{61}\u{74}\u{65}\u{73}\u{74}\u{20}\u{41}\u{70}\u{70}\u{6C}\u{65}\u{20}\u{70}\u{72}\u{69}\u{76}\u{61}\u{63}\u{79}\u{20}\u{70}\u{6F}\u{6C}\u{69}\u{63}\u{79}\u{20}\u{68}\u{61}\u{73}\u{20}\u{79}\u{65}\u{74}\u{20}\u{74}\u{6F}\u{20}\u{62}\u{65}\u{20}\u{61}\u{63}\u{6B}\u{6E}\u{6F}\u{77}\u{6C}\u{65}\u{64}\u{67}\u{65}\u{64}")
        XCTAssertEqual(String.RATING_ALERT_TITLE｜StoreKit, "\u{50}\u{6C}\u{65}\u{61}\u{73}\u{65}\u{20}\u{52}\u{61}\u{74}\u{65}")
        XCTAssertEqual(String.STORE｜StoreKit, "\u{53}\u{74}\u{6F}\u{72}\u{65}")
        XCTAssertEqual(String.SUBMIT｜StoreKit, "\u{53}\u{65}\u{6E}\u{64}")
        XCTAssertEqual(String.TERMS_AND_CONDITIONS｜StoreKit, "\u{54}\u{65}\u{72}\u{6D}\u{73}\u{20}\u{61}\u{6E}\u{64}\u{20}\u{43}\u{6F}\u{6E}\u{64}\u{69}\u{74}\u{69}\u{6F}\u{6E}\u{73}")
        XCTAssertEqual(String.UNKNOWN_ERROR｜StoreKit, "\u{41}\u{6E}\u{20}\u{75}\u{6E}\u{6B}\u{6E}\u{6F}\u{77}\u{6E}\u{20}\u{65}\u{72}\u{72}\u{6F}\u{72}\u{20}\u{6F}\u{63}\u{63}\u{75}\u{72}\u{72}\u{65}\u{64}")
        XCTAssertEqual(String.VIEW_IN_STORE｜StoreKit, "\u{56}\u{69}\u{65}\u{77}\u{20}\u{69}\u{6E}\u{20}\u{53}\u{74}\u{6F}\u{72}\u{65}")
    }

    func test_ar() {
        Util｜StoreKit.preferredLocalization = "\u{61}\u{72}"
        XCTAssertEqual(String.AGREE｜StoreKit, "\u{645}\u{648}\u{627}\u{641}\u{642}\u{629}")
        XCTAssertEqual(String.AGREE_TEXT｜StoreKit, "\u{623}\u{646}\u{627}\u{20}\u{623}\u{648}\u{627}\u{641}\u{642}\u{20}\u{639}\u{644}\u{649}\u{20}\u{623}\u{62D}\u{643}\u{627}\u{645}\u{20}\u{648}\u{634}\u{631}\u{648}\u{637}\u{20}\u{627}\u{644}\u{640}\u{20}\u{69}\u{54}\u{75}\u{6E}\u{65}\u{73}\u{2E}")
        XCTAssertEqual(String.CANCEL｜StoreKit, "\u{625}\u{644}\u{63A}\u{627}\u{621}")
        XCTAssertEqual(String.CLOUD_SERVICE_SETUP_VIEW_CONTROLLER_LOAD_PREEMPTED｜StoreKit, "\u{62A}\u{645}\u{20}\u{627}\u{633}\u{62A}\u{628}\u{627}\u{642}\u{20}\u{62A}\u{62D}\u{645}\u{64A}\u{644}\u{20}\u{648}\u{62D}\u{62F}\u{629}\u{20}\u{62A}\u{62D}\u{643}\u{645}\u{20}\u{639}\u{631}\u{636}\u{20}\u{625}\u{639}\u{62F}\u{627}\u{62F}\u{20}\u{62E}\u{62F}\u{645}\u{629}\u{20}\u{627}\u{644}\u{633}\u{62D}\u{627}\u{628}\u{629}")
        XCTAssertEqual(String.CLOUD_SERVICE_SETUP_VIEW_CONTROLLER_MISSING_SYSTEM_MUSIC_APPLICATION｜StoreKit, "\u{641}\u{634}\u{644}\u{20}\u{62A}\u{62D}\u{645}\u{64A}\u{644}\u{20}\u{648}\u{62D}\u{62F}\u{629}\u{20}\u{62A}\u{62D}\u{643}\u{645}\u{20}\u{639}\u{631}\u{636}\u{20}\u{625}\u{639}\u{62F}\u{627}\u{62F}\u{20}\u{62E}\u{62F}\u{645}\u{629}\u{20}\u{627}\u{644}\u{633}\u{62D}\u{627}\u{628}\u{629}\u{20}\u{644}\u{623}\u{646}\u{647}\u{20}\u{62A}\u{645}\u{20}\u{645}\u{633}\u{62D}\u{20}\u{62A}\u{637}\u{628}\u{64A}\u{642}\u{20}\u{627}\u{644}\u{645}\u{648}\u{633}\u{64A}\u{642}\u{649}\u{2E}\u{20}\u{64A}\u{645}\u{643}\u{646}\u{20}\u{625}\u{639}\u{627}\u{62F}\u{629}\u{20}\u{62A}\u{62B}\u{628}\u{64A}\u{62A}\u{20}\u{62A}\u{637}\u{628}\u{64A}\u{642}\u{20}\u{627}\u{644}\u{645}\u{648}\u{633}\u{64A}\u{642}\u{649}\u{20}\u{645}\u{646}\u{20}\u{41}\u{70}\u{70}\u{A0}\u{53}\u{74}\u{6F}\u{72}\u{65}\u{2E}")
        XCTAssertEqual(String.CLOUD_SERVICE_SETUP_VIEW_CONTROLLER_REQUIRES_ACTION｜StoreKit, "\u{648}\u{62D}\u{62F}\u{629}\u{20}\u{62A}\u{62D}\u{643}\u{645}\u{20}\u{639}\u{631}\u{636}\u{20}\u{625}\u{639}\u{62F}\u{627}\u{62F}\u{20}\u{62E}\u{62F}\u{645}\u{629}\u{20}\u{627}\u{644}\u{633}\u{62D}\u{627}\u{628}\u{629}\u{20}\u{62A}\u{62A}\u{637}\u{644}\u{628}\u{20}\u{625}\u{62C}\u{631}\u{627}\u{621}\u{20}\u{643}\u{62C}\u{632}\u{621}\u{20}\u{645}\u{646}\u{20}\u{627}\u{644}\u{62E}\u{64A}\u{627}\u{631}\u{627}\u{62A}\u{20}\u{644}\u{623}\u{645}\u{631}\u{20}\u{627}\u{644}\u{62A}\u{62D}\u{645}\u{64A}\u{644}")
        XCTAssertEqual(String.DISAGREE｜StoreKit, "\u{639}\u{62F}\u{645}\u{20}\u{627}\u{644}\u{645}\u{648}\u{627}\u{641}\u{642}\u{629}")
        XCTAssertEqual(String.INVALID_PRODUCTS_FOUND｜StoreKit, "\u{647}\u{646}\u{627}\u{643}\u{20}\u{645}\u{646}\u{62A}\u{62C}\u{20}\u{648}\u{627}\u{62D}\u{62F}\u{20}\u{623}\u{648}\u{20}\u{645}\u{646}\u{62A}\u{62C}\u{627}\u{62A}\u{20}\u{63A}\u{64A}\u{631}\u{20}\u{635}\u{627}\u{644}\u{62D}\u{629}\u{2E}")
        XCTAssertEqual(String.NETWORK_FAILED｜StoreKit, "\u{62A}\u{639}\u{630}\u{631}\u{20}\u{627}\u{644}\u{627}\u{62A}\u{635}\u{627}\u{644}\u{20}\u{628}\u{640}\u{20}\u{69}\u{54}\u{75}\u{6E}\u{65}\u{73}\u{20}\u{53}\u{74}\u{6F}\u{72}\u{65}")
        XCTAssertEqual(String.PERMISSION_DENIED｜StoreKit, "\u{627}\u{644}\u{62A}\u{637}\u{628}\u{64A}\u{642}\u{20}\u{627}\u{644}\u{630}\u{64A}\u{20}\u{642}\u{627}\u{645}\u{20}\u{628}\u{627}\u{644}\u{637}\u{644}\u{628}\u{20}\u{644}\u{64A}\u{633}\u{20}\u{644}\u{62F}\u{64A}\u{647}\u{20}\u{627}\u{644}\u{623}\u{630}\u{648}\u{646}\u{627}\u{62A}\u{20}\u{627}\u{644}\u{644}\u{627}\u{632}\u{645}\u{629}")
        XCTAssertEqual(String.PRIVACY_ACKNOWLEDGEMENT_REQUIRED｜StoreKit, "\u{645}\u{627}\u{632}\u{627}\u{644}\u{20}\u{64A}\u{62C}\u{628}\u{20}\u{625}\u{642}\u{631}\u{627}\u{631}\u{20}\u{623}\u{62D}\u{62F}\u{62B}\u{20}\u{633}\u{64A}\u{627}\u{633}\u{629}\u{20}\u{62E}\u{635}\u{648}\u{635}\u{64A}\u{629}\u{20}\u{644}\u{640}\u{A0}\u{41}\u{70}\u{70}\u{6C}\u{65}")
        XCTAssertEqual(String.RATING_ALERT_TITLE｜StoreKit, "\u{627}\u{644}\u{631}\u{62C}\u{627}\u{621}\u{20}\u{642}\u{64A}\u{651}\u{645}")
        XCTAssertEqual(String.STORE｜StoreKit, "\u{627}\u{644}\u{645}\u{62A}\u{62C}\u{631}")
        XCTAssertEqual(String.SUBMIT｜StoreKit, "\u{625}\u{631}\u{633}\u{627}\u{644}")
        XCTAssertEqual(String.TERMS_AND_CONDITIONS｜StoreKit, "\u{627}\u{644}\u{623}\u{62D}\u{643}\u{627}\u{645}\u{20}\u{648}\u{627}\u{644}\u{634}\u{631}\u{648}\u{637}")
        XCTAssertEqual(String.UNKNOWN_ERROR｜StoreKit, "\u{62D}\u{62F}\u{62B}\u{20}\u{62E}\u{637}\u{623}\u{20}\u{63A}\u{64A}\u{631}\u{20}\u{645}\u{639}\u{631}\u{648}\u{641}")
        XCTAssertEqual(String.VIEW_IN_STORE｜StoreKit, "\u{639}\u{631}\u{636}\u{20}\u{641}\u{64A}\u{20}\u{627}\u{644}\u{645}\u{62A}\u{62C}\u{631}")
    }

    func test_ca() {
        Util｜StoreKit.preferredLocalization = "\u{63}\u{61}"
        XCTAssertEqual(String.AGREE｜StoreKit, "\u{41}\u{63}\u{63}\u{65}\u{70}\u{74}\u{61}\u{72}")
        XCTAssertEqual(String.AGREE_TEXT｜StoreKit, "\u{41}\u{63}\u{63}\u{65}\u{70}\u{74}\u{6F}\u{20}\u{65}\u{6C}\u{73}\u{20}\u{74}\u{65}\u{72}\u{6D}\u{65}\u{73}\u{20}\u{69}\u{20}\u{6C}\u{65}\u{73}\u{20}\u{63}\u{6F}\u{6E}\u{64}\u{69}\u{63}\u{69}\u{6F}\u{6E}\u{73}\u{20}\u{64}\u{65}\u{20}\u{6C}\u{2019}\u{69}\u{54}\u{75}\u{6E}\u{65}\u{73}\u{2E}")
        XCTAssertEqual(String.CANCEL｜StoreKit, "\u{43}\u{61}\u{6E}\u{63}\u{65}\u{6C}\u{B7}\u{6C}\u{61}\u{72}")
        XCTAssertEqual(String.CLOUD_SERVICE_SETUP_VIEW_CONTROLLER_LOAD_PREEMPTED｜StoreKit, "\u{4C}\u{61}\u{20}\u{63}\u{E0}\u{72}\u{72}\u{65}\u{67}\u{61}\u{20}\u{64}\u{65}\u{6C}\u{20}\u{63}\u{6F}\u{6E}\u{74}\u{72}\u{6F}\u{6C}\u{61}\u{64}\u{6F}\u{72}\u{20}\u{64}\u{65}\u{20}\u{6C}\u{61}\u{20}\u{76}\u{69}\u{73}\u{74}\u{61}\u{20}\u{64}\u{65}\u{20}\u{63}\u{6F}\u{6E}\u{66}\u{69}\u{67}\u{75}\u{72}\u{61}\u{63}\u{69}\u{F3}\u{20}\u{64}\u{65}\u{6C}\u{20}\u{73}\u{65}\u{72}\u{76}\u{65}\u{69}\u{20}\u{61}\u{6C}\u{20}\u{6E}\u{FA}\u{76}\u{6F}\u{6C}\u{20}\u{73}\u{2019}\u{68}\u{61}\u{20}\u{61}\u{74}\u{75}\u{72}\u{61}\u{74}")
        XCTAssertEqual(String.CLOUD_SERVICE_SETUP_VIEW_CONTROLLER_MISSING_SYSTEM_MUSIC_APPLICATION｜StoreKit, "\u{4E}\u{6F}\u{20}\u{73}\u{2019}\u{68}\u{61}\u{20}\u{70}\u{6F}\u{67}\u{75}\u{74}\u{20}\u{63}\u{61}\u{72}\u{72}\u{65}\u{67}\u{61}\u{72}\u{20}\u{65}\u{6C}\u{20}\u{63}\u{6F}\u{6E}\u{74}\u{72}\u{6F}\u{6C}\u{61}\u{64}\u{6F}\u{72}\u{20}\u{64}\u{65}\u{20}\u{6C}\u{61}\u{20}\u{76}\u{69}\u{73}\u{74}\u{61}\u{20}\u{64}\u{65}\u{20}\u{63}\u{6F}\u{6E}\u{66}\u{69}\u{67}\u{75}\u{72}\u{61}\u{63}\u{69}\u{F3}\u{20}\u{64}\u{65}\u{6C}\u{20}\u{73}\u{65}\u{72}\u{76}\u{65}\u{69}\u{20}\u{61}\u{6C}\u{20}\u{6E}\u{FA}\u{76}\u{6F}\u{6C}\u{20}\u{70}\u{65}\u{72}\u{71}\u{75}\u{E8}\u{20}\u{6C}\u{2019}\u{61}\u{70}\u{70}\u{20}\u{4D}\u{FA}\u{73}\u{69}\u{63}\u{61}\u{20}\u{73}\u{2019}\u{68}\u{61}\u{20}\u{65}\u{6C}\u{69}\u{6D}\u{69}\u{6E}\u{61}\u{74}\u{2E}\u{20}\u{50}\u{6F}\u{74}\u{73}\u{20}\u{72}\u{65}\u{69}\u{6E}\u{73}\u{74}\u{61}\u{6C}\u{B7}\u{6C}\u{61}\u{72}\u{2011}\u{6C}\u{61}\u{20}\u{64}\u{65}\u{73}\u{20}\u{64}\u{65}\u{20}\u{6C}\u{2019}\u{41}\u{70}\u{70}\u{20}\u{53}\u{74}\u{6F}\u{72}\u{65}\u{2E}")
